_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"200196","type":"CustomJS"},{"attributes":{"source":{"id":"200042"}},"id":"200112","type":"CDSView"},{"attributes":{"children":[{"id":"200243"},{"id":"200245"}],"sizing_mode":"stretch_width"},"id":"200246","type":"Row"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"200073","type":"BoxAnnotation"},{"attributes":{},"id":"200186","type":"AllLabels"},{"attributes":{},"id":"200056","type":"LinearScale"},{"attributes":{"source":{"id":"200093"}},"id":"200106","type":"CDSView"},{"attributes":{"axis":{"id":"200018"},"coordinates":null,"group":null,"ticker":null},"id":"200021","type":"Grid"},{"attributes":{"coordinates":null,"formatter":{"id":"200185"},"group":null,"major_label_policy":{"id":"200186"},"ticker":{"id":"200150"},"visible":false},"id":"200149","type":"LinearAxis"},{"attributes":{},"id":"200054","type":"LinearScale"},{"attributes":{"below":[{"id":"200149"}],"center":[{"id":"200152"},{"id":"200156"},{"id":"200190"}],"height":90,"left":[{"id":"200153"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_bor
